import React from 'react';
import * as S from './ComponentStyled';

export default function SetTelescope() {
  return (
    <div style={{ marginBottom: '10px' }}>
      <S.Title>Set Telescope</S.Title>

      <div style={{ display: 'flex' }}>
        <div></div>
        <div></div>
      </div>
    </div>
  );
}
